import React from "react";
import IntlMessages from "../../../../util/IntlMessages";
import CardBox from "../../../../components/CardBox/index";
import Can from "../../../../can";
import { RoleContext } from "../../../../Context";
import Fab from "@material-ui/core/Fab";
import AddIcon from "@material-ui/icons/Add";
import TextField from "@material-ui/core/TextField";
import Button from "@material-ui/core/Button";
import RemoveSharpIcon from "@material-ui/icons/RemoveSharp";
import { connect } from "react-redux";
import InputLabel from "@material-ui/core/InputLabel";
import MenuItem from "@material-ui/core/MenuItem";
import {
  KeyboardDatePicker,
  MuiPickersUtilsProvider,
} from "@material-ui/pickers";
import DateFnsUtils from "@date-io/moment";
import FormControl from "@material-ui/core/FormControl";
import Select from "@material-ui/core/Select";
import Input from "@material-ui/core/Input";
import Chip from "@material-ui/core/Chip";
import Avatar from "@material-ui/core/Avatar";
import { makeStyles } from "@material-ui/core/styles";
const paymentMode = [
  {
    value: "Mensuel",
    label: <IntlMessages id="mode_payment.establishment.monthly" />,
  },
  {
    value: "Trimestre",
    label: <IntlMessages id="mode_payment.establishment.trimester" />,
  },
  {
    value: "Semestre",
    label: <IntlMessages id="mode_payment.establishment.semester" />,
  },
  {
    value: "Annuel",
    label: <IntlMessages id="mode_payment.establishment.annual" />,
  },
];

const ITEM_HEIGHT = 48;
const ITEM_PADDING_TOP = 8;
class AddSchoolLicence extends React.Component {
  constructor(props) {
    super(props);

    this.state = {};
  }
  render() {
    return (
      <div>
        <RoleContext.Consumer>
          {({ role }) => (
            <Can
              role={role}
              perform="add-service"
              yes={() => (
                <div>
                  <form autoComplete="off" onSubmit={this.props.handleSubmit}>
                    <div className="d-flex justify-content-start align-items-center">
                      <h1>
                        <b>
                          <IntlMessages id="new.School.licence" />
                        </b>
                      </h1>
                      &nbsp;&nbsp;&nbsp;
                      <Fab
                        size="small"
                        color="primary"
                        aria-label="Add"
                        onClick={this.props.openAddModal}
                      >
                        {this.state.isOpen ? <RemoveSharpIcon /> : <AddIcon />}
                      </Fab>
                    </div>
                    <br />
                    {this.props.values.isOpen ? (
                      <>
                        {" "}
                        <CardBox styleName=" text-black  ">
                          <div className="d-flex flex-column  ">
                            <div className="d-flex flex-wrap  align-items-center ">
                              <div className="col-md-4 ">
                                <TextField
                                  id="establishementId"
                                  name="establishementId"
                                  select
                                  required
                                  label={
                                    <IntlMessages id="establishement.choice" />
                                  }
                                  value={this.props.values.establishment}
                                  onChange={this.props.handleChange(
                                    "establishementId"
                                  )}
                                  SelectProps={{}}
                                  margin="normal"
                                  defaultValue=""
                                  fullWidth
                                >
                                  {this.props.establishmentsList.map((Item) => (
                                    <MenuItem key={Item.id} value={Item}>
                                      {Item.name}
                                    </MenuItem>
                                  ))}
                                </TextField>
                              </div>
                              <div className="col-md-4  ">
                                <TextField
                                  id="schoolYearId"
                                  name="schoolYearId"
                                  select
                                  required
                                  label={
                                    <IntlMessages id="schoolYear.choice" />
                                  }
                                  value={this.props.values.schoolYearId}
                                  onChange={this.props.handleChangeSchoolYears(
                                    "schoolYearId"
                                  )}
                                  SelectProps={{}}
                                  margin="normal"
                                  defaultValue=""
                                  fullWidth
                                >
                                  {this.props.schoolYearList.map((Item) => (
                                    <MenuItem key={Item.id} value={Item.id}>
                                      {Item.name}
                                    </MenuItem>
                                  ))}
                                </TextField>
                              </div>
                              <div className="col-md-4  ">
                                <TextField
                                  id="licenceType"
                                  name="licenceType"
                                  select
                                  required
                                  value={this.props.values.licenceType}
                                  onChange={this.props.handleChange(
                                    "licenceType"
